var suggestions=document.getElementById('suggestions'),search=document.getElementById('search');search!==null&&document.addEventListener('keydown',inputFocus);function inputFocus(a){a.ctrlKey&&a.key==='/'&&(a.preventDefault(),search.focus()),a.key==='Escape'&&(search.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(c){const d=suggestions.classList.contains('d-none');if(d)return;const a=[...suggestions.querySelectorAll('a')];if(a.length===0)return;const b=a.indexOf(document.activeElement);if(c.key==="ArrowUp"){c.preventDefault();const d=b>0?b-1:0;a[d].focus()}else if(c.key==="ArrowDown"){c.preventDefault();const d=b+1<a.length?b+1:b;a[d].focus()}}(function(){var a=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:'id',store:["href","title","description"],index:["title","description","content"]}});a.add({id:0,href:"/docs/community/about/",title:"About Scicloj",description:"What #\rScicloj is an open, free and dynamic hub for building a Clojure ecosystem for data science, scientific computing and data engineering.\nIn short, it is for anyone who is interested in using Clojure to work with data.\nThere are various places where activities move forward (for more info check the Where section), and they are all open to discussion and contribution.\nWho #\rWe are Clojurians coming from very different backgrounds and with very different levels of knowledge around Clojure and data science who share a common goal: making Clojure and data science better by combining them.",content:"What #\rScicloj is an open, free and dynamic hub for building a Clojure ecosystem for data science, scientific computing and data engineering.\nIn short, it is for anyone who is interested in using Clojure to work with data.\nThere are various places where activities move forward (for more info check the Where section), and they are all open to discussion and contribution.\nWho #\rWe are Clojurians coming from very different backgrounds and with very different levels of knowledge around Clojure and data science who share a common goal: making Clojure and data science better by combining them.\nEveryone is welcome to contribute, to consume and to use Scicloj however they like.\nWhy #\rA few people met on the internet one day and they all shared the same thought: Clojure is great, data science is cool, let\u0026rsquo;s put them together to make a crying rainbow of awesomeness! The first issues encountered led to a couple of revelations: Clojure is indeed cool, but data science relies heavily on FOSS libraries and tools that in Clojureland are all scattered around and usually poorly documented.\nScicloj is an umbrella for libraries, tutorials, ideas and open discussion trying to move further the idea that not only data science is possible with Clojure, but it can be a very nice experience as well (and it just works!).\nHow #\rScicloj tries to create broad discussions, where community members can reason together about their common goals.\nAt the same time, it maintains dedicated task groups that can have discussion around certain topics, such as: machine learning, wrapping useful data science libraries for use with Clojure, writing tutorials, organizing the community, editing the Scicloj website, and more.\nIn addition to textual, everyday discussions, Scicloj encourages meetings in small groups, as well as larger gatherings.\nWhere #\rContact details\n"}).add({id:1,href:"/docs/community/getting_involved/",title:"Getting Involved",description:"Would you like to join our journey in making Clojure a joyful platform for data science?\nBelow are some suggested ways to get involved. If you are interested in any of these, or maybe have some other idea - then let us talk! We may possibly help in finding a nice way to begin.\nJoin our dev and study groups #\rScicloj is organizing a few dev groups and study groups that meet regularly to learn, to brainstorm, and to create.",content:" Would you like to join our journey in making Clojure a joyful platform for data science?\nBelow are some suggested ways to get involved. If you are interested in any of these, or maybe have some other idea - then let us talk! We may possibly help in finding a nice way to begin.\nJoin our dev and study groups #\rScicloj is organizing a few dev groups and study groups that meet regularly to learn, to brainstorm, and to create. Your perspective could be helpful there.\nShare your experience #\rHearing about your personal workflow, data stories, problems and ideas can be valuable to others. Just open a new topic at one of the other relevant chat streams, and share your thoughts.\nWrite a tutorial #\rWriting tutorials (either small or big) about working with data is central to our process. The importance is twofold: sharing realistic experiences, and realizing what may be missing or could be improved in our stack. You may just pick an existing tutorial and translate it to Clojure. Or, you can pick some fresh new data and start analysing them from scratch.\nJoin the organizing team #\rAre you interested in the human aspects of growing the community? Or, do you want to be involved in the thought process about the goals and priorities of this community? Then the scicloj organizing team would welcome you to join. Even if your time is limited, contributing your thought can be important.\nPair with a library author #\rLibrary authors need users. Some of the actively developed libraries would benefit a lot from a user trying to use them and sharing their findings.\nHelp building the website and knowledge base #\rThe scicloj website would love to have more people involved in it. Contributing to the content organization, writing opinionated blog posts, helping with the aesthetics \u0026ndash; all would be welcome.\nCreate some proof of concept #\rDo you think that something is missing in our stack? Then let us maybe create it! Beginning with a small proof of concept, you can test the idea with other community members. If you suggest your idea, maybe someone will be happy to join you, and you create it together.\nContribute to a library #\rIs there any library that you are curious to learn about or just want to help building? Then a good way to learn may be to contribute. This may be some help in adding a feature, adding some tests, or writing documentation. You can offer that to the library author. Some would be happy and might offer a nice way to begin.\nSubmit an issue #\rHave you found a bug or a missing feature? Probably, the maintainers of actively developed libraries would be happy to know about it. Usually, the project Issues page or the project Zulip stream would be the place to do that. Most projects mention the preferred ways of communication in their README.\n"}).add({id:2,href:"/docs/community/chat/",title:"Chat streams",description:"The Clojurians Zulip #\rMost of our communication takes place in specific streams at the Clojurians Zulip chat.\nSmall task groups often create ad-hoc streams for their task, but a lot of the communitcation takes place in more popular, long-living streams (examples below).\nMost streams are public, some are private. Usually, streams are chosen to be private not for secrecy, but for focus, and for creating an atmosphere where people are comfortable talking, knowing who are listening.",content:"The Clojurians Zulip #\rMost of our communication takes place in specific streams at the Clojurians Zulip chat.\nSmall task groups often create ad-hoc streams for their task, but a lot of the communitcation takes place in more popular, long-living streams (examples below).\nMost streams are public, some are private. Usually, streams are chosen to be private not for secrecy, but for focus, and for creating an atmosphere where people are comfortable talking, knowing who are listening.\nThis original announcement of the Clojurians Zulip by Gert Goet gives some context and explains why it makes sense for some parts of the Clojure community to move into Zulip. Scicloj followed that advice.\nRelevant active streams #\rHere are the main scicloj-related active streams, dedicated to certain subgroups, child communities or sister communities of scicloj.\nGeneral discussion and Q\u0026amp;A #\r #data-science - general data science topics  Dev chat of specific tools and libraries #\r  #tech.ml.dataset.dev - discussing tech.ml.dataset\n  #uncomplicate - discussions about developing with Neanderthal, Deep Diamond, and other Uncomplicate libs\n  #scicloj.ml-dev - discussing scicloj.ml\n  #clay-dev - discussing the development of Clay\n  #noj-dev - discussing the development of Noj\n  #cljplot-dev - cljplot develompemt\n  #saite-dev - development of Saite and related projects such as Hanami\n  #hanamicloth-dev - development of Hanacloth\n  #pink-gorilla-dev - development of Pink Gorilla\n  #notespace-dev - notespace development\n  #libpython-clj-dev - libpython-clj development and usage\n  #libapl-clj-dev - libapl-clj development and usage\n  #clojisr-dev - clojisr development\n  #r-interop - R-interop development and usage: various libraries such as graalvm-interop and clojisr\n  Active study groups / dev groups #\rFor more information, see also the list of dev \u0026amp; study groups at the website.\n  #ds4clj - the Data Science for Clojure Devs course\n  #data-recur - recurring updates \u0026amp; discussions around building the emerging data stack\n  #visual-tools - the stream of the visual-tools group, discussing collaborations around tooling for data visualization and literate programming\n  #wolfram-clojure-bridge - a stream for the monthly meetings around the Clojure bridge to the Wolfram Language.\n  #real-world-data - a stream for the real-world-data study group, discussing uses of Clojure in real-world data projects.\n  #scicloj-org - a private stream of the scicloj organizing team - for anybody interested in building the scicloj community and discssing its goals and priorities - let us talk if you wish to join.\n  General streams worth knowing about: #\r  #announce - aggregation of announcements of other Clojure communication platforms (Clojureverse, Reddit /r/Clojure, etc.)\n  #beginners\n  #clojure - general Clojure discussions\n  #slack-archive - an archive of selected channels of the Clojurians Slack (if some channel you like is not there, you may ask the admins at the #zulip stream to add it)\n  #new-members - introductions of new Clojurians Zulip members\n  #zulip - discussing the Zulip platform, asking for technical help\n  Inactive streams of the past, that might be of interest #\r  #sci-fu - Scicloj foundations study group - learning together to build the Clojure data science ecosystem\n  #ml-study - machine learning and data analysis study sessions\n  #sicmutils - updates and discussions about sicmutils and its study group\n  #scicloj-tutorials - discussing community efforts for creating tutorials (a bit inactive as of 2022 Q1)\n  #covid-19 - studying COVID-19 data (past hackathons and general discussions)\n  #nov21-workshops - a stream for the re:Clojure 2021 workshops\n  #dec21-data-science-special - a stream for the 2021 re:Clojure Data Science Special event\n  Recommended practices #\rYou may wish to learn a little bit about the concepts of Zulip streams and topics. Note that all streams and topics (and even single messages) have URLs, that you can open at separate tabs in your browser.\nWhen joining Zulip, it is a good idea to present yourself at the #new-members / hello topic, and in general, at topics called \u0026lsquo;hello\u0026rsquo; or \u0026lsquo;personal introductions\u0026rsquo; at specific streams you are subscribing to, mainly this \u0026lsquo;hello\u0026rsquo; topic at the #data-science stream.\nWhen reading the feed to cactch up, it is sometimes comfortable to browse through the aggregate feed of all streams, or at the feed of a specific stream, such as #data-science.\nWhen writing messages, it is recommended to be at the page of a specific topic, e.g. #data-science / tech.ml.dataset. That would prevent some very common mistake, of writing under the wrong topic.\nYou may wish to configure the streams-notifications behaviours to your taste.\nTo discover conversations relevant to you, you may browse and subscribe to streams. To see the feed of all public streams, including those you are not subscribed to, you can look at this URL (note that we are filtering out the huge #slack-archive stream).\n"}).add({id:3,href:"/docs/community/events/",title:"Events",description:"Our public events are shared at the Clojure calendar feed.",content:"Our public events are shared at the Clojure calendar feed.\n"}).add({id:4,href:"/docs/community/contact/",title:"Contact",description:" scicloj@gmail.com GitHub Zulip Chat streams  Main data science stream   Twitter Youtube  ",content:" scicloj@gmail.com GitHub Zulip Chat streams  Main data science stream   Twitter Youtube  "}).add({id:5,href:"/docs/resources/libs/",title:"Tools and libraries",description:"Clojure tools and libraries for data and science",content:" To supplement our opinionated discussions of the ecosystem, here is a less-opinionated, plain list of relevant libraries written by Clojurians. Not all libraries mentioned here are affiliated with Scicloj, but we seek to be in dialogue with library authors as much as possible.\nDo you know about anything relevant that is missing here? - Let us talk!\nFor every library, we mark whether it is actively developed (act), and whether it is still experimental (exp). A star (â­) means that we know the library to be actively used and useful.\nWe tag libraries with the field they are relevant to.\n array - array programming tensor - tensor programming linalg - linear algebra native - interop with native-optimized libraries gpu - gpu support vis - data visualization and visual art vega - visualization using Vega/Vega-lite specifications lit - literate programming ui - building UIs for data exploration geo - geographical and geometrical data processing df - dataframe-like data structures and abstractions data - general data processing csv - csv import/export xl - Excel spreadsheets interaction json - json import/export xform - transducers support math - diverse math functions stat - statistics ts - time series analysis rand - simulation and random sampling prob - Bayesian computing and probabilistic programming ml - machine learning dnn - deep learning opt - optimization graph - graph algorithms and network analysis interop - general libraries for interop cljs - supports not only Clojure but also Clojurescript nlp - natural language processing llm - large language models and related services  Other lists ðŸ”— #\rThese other lists of libraries are very relevant to the emerging Clojure data science stack:\n Clojurelog â­ by the XTDB team - a comparison of various Clojure-Datalog databases Clojure DSL resources â­ by Simon Gray - a curated list of mostly mature and/or actively developed Clojure resources relevant for dealing with domain-specific languages, in particular parsing and data transformation with/of DSLs. Clojure graph resources â­ by Simon Gray - a curated list of mostly mature and/or actively developed Clojure resources relevant for dealing with graph-like data  Diverse toolsets #\r fastmath â­ (act): math,ml,rand,stat - a collection of functions for mathematical and statistical computing, machine learning, etc., wrapping several JVM libraries noj â­ (act): - a work-in-progress library collecting a few of the relevant data \u0026amp; science with additional convenience layers composing them together spork (act): df,graph,opt,rand,ui,vis - a toolbox for data-science and operation research Incanter: csv,df,rand,stat,vis - an R-like data-science platform built on top of the core.matrix abstractions huri: df,stat,vis - a toolbox for data-science using plain sequences of maps  Optimization #\r matlib â­ (act): opt - optimisation and control theory tools and convenience functions based on Neanderthal.  Visual tools: literate programming and data visualization #\r Saite â­ (act): cljs,hiccup,lit,ui,vega,vis - data exploration, dashboards, and interactive documents Oz â­ (act): lit,vega,vis - data visuzliation using Vega/Vega-Lite and Hiccup, and a live-reload platform for literate-programming Clerk â­ (act): cljs,lit,vega,vis - local-first notebooks for Clojure Clay â­ (act): cljs,lit,vega,vis - a small tool for data visualization and literate programming rmarkdown-clojure â­: lit,vis - rendering Clojure code in various format using Rmarkdown Pink-Gorilla/Goldly â­ (act): cljs,exp,lit,ui,vis - a port of the Gorilla REPL project using a Clojurescript (Reagent) frontend Org-babel-clojure â­: lt - executing Clojure inside Emacs Org-mode documents Devcards â­: cljs,lit - visual repl exprience for Clojurescript Notespace â­: exp,lit - notebook experience with Clojure namespaces edited at any editor Reveal â­ (act): - browser-based data navigation GUI Portal â­ (act): - desktop data navigation GUI Gorilla-REPL: lit - a notebook application written in Clojure and Javascript proto-repl-charts: vis - an Atom plugin for displaying tables and graphs Maria (act): cljs,lit,vis - a Clojurescript coding environment for beginners emmy-viewers â­ (act): cljs,vis - High-performance symbolic, 2D and 3D visual extensions to the Emmy computer algebra system  Vega rendering #\rIn addition to a few of the tools mentioned above, here is a list of dedicated tools dedicated mainly to handling Vega/Vega-lite specifications. See this conversation for some discussion of the differences and tradeoffs across these tools.\n darkstar â­: vega,vis - a minimal wrapper over Vega/Vega-lite as a single JVM-only Clojure library, using the GraalJS javascript runtime, which does not require GraalVM runtime to run. xvsy: cljs,vega,vis - grammer of graphics over Vega Vegan (act): vega,vis - a nodejs clojurescript library designed to validate and render Vega and Vega-lite files, supports docker-based setup Vega-clj (act): vega,vis - a clojure wrapper for the (node-based) Vega-cli and Vega-lite standalone scrips Optikon: vega,vis - a command line tool that wraps Vega and Vega-lite, using GraalVM polyglot programming Vegafx: vega,vis - a static-site viewer using javafx that renders Vega specs VL example gallery as EDN: - The vega lite example in EDN format, ready to be copy/pasted into Clojure code  Data visualization libraries #\r cljplot â­ (act): exp,vis - a data visualization platform written in Clojure and inspired by R\u0026rsquo;s ggplot2 and lattice libraries Hanami â­ (act): cljs,hiccup,ui,vega,vis - a template system for creating interactive data visualizations using Vega/Vega-lite, Reagent and Re-Com Hanamicloth â­ (act): exp,vega,vis - a data visualization grammar composing Hanami templates and Tablecloth datasets darkstar â­ (act): cljs,vega,vis - simple data visualization for Clojure/Clojurescript that using vega and darkstar for rendering : exp,vega,vis - a data visualization library for beginners (WIP) Clojure2D â­ (act): vis - Java2D wrapper + creative coding supporting functions (based on Processing and openFrameworks) Quil â­: vis - a clojure/clojuresctit wrapper for Processing thi-ng/geom â­: cljs,vis - 2d/3d geometry toolkit Gorilla-plot â­: vega,vis - plotting functions using Vega for Gorilla-REPL gg4clj: r,vis - a clojure DSL for creating ggplot2 plots using R gg4clj port: - by the Pink Gorilla project Analemma: cljs,exp,vis - generating charts and SVG with a syntax similar to Incanter\u0026rsquo;s and a visual theme similar to ggplot2. emacs-Vega-view (act): vega,vis - an emacs mode to facilitate interactive data visualization using Vega from within emacs. Supports elisp, json and clojure notations  Data processing #\r ham-fisted â­ (act): data - data structures, functions, and macros for efficient functional programming in the JVM Specter â­ (act): cljs,data - declarative navigation of nested data structures for selection and transformation in Clojure and Clojurescript Meander â­ (act): cljs,data - transforming neseted data structures by declaratively declaring the shape of source and target datastructures xforms â­: cljs,data,xform - a collection of transduces and reducing functions Odin: data - processing nested data structures by extensible logic programming Charred â­ (act): csv,json - zero dependency efficient read/write of json and csv data. Semantic Csv: cljs,csv - higher level csv parsing/processing  Geospatial processing #\r geo â­: geo - unifying several JVM libraries for geoprocessing with a Clojure API ovid â­: exp,geo - protocols for geospatial concepts aurelius â­: exp,geo,xform - transducible analysis of geospatial features geo-clj â­: cljs,geo - encoding/decoding of geographic datatypes  Dataframe-like structures #\r tech.ml.dataset â­ (act): csv,df,stat,vis - abstractions for dataframe-like structures in clojure, based on dtype-next infrastructure tablecloth â­ (act): csv,df - a dataframe grammar wrapping tech.ml.dataset, inspired by serveral R libraries clojask â­ (act): df - a library for parallel computing of larger-than-memory datasets. datajure (act): df - a domain-specific language for data processing wrapping libraries such as tech.ml.dataset, tablecloth, clojask, and geni Panthera: df,py - a Clojure API wrapping Python\u0026rsquo;s Pandas library koala: csv,df,exp - Pandas-like data-processing for clojure with some I/O functionality (experimental) dataframe: df - Pandas-like data processing for clojure danzig (act): df,exp,xform - Pandas-like data processing using transducers (danzig was formerly named wombat) bamboo: df - a minimal data processing library for Clojure, with some of the capabilities of pandas and numpy see also geni â­ under the Spark sub category below  Spreadsheets #\r Docjure â­ (act): xl - making it easy to read and write Excel spreadsheets as Clojure data kixi.large â­ (act): exp,xl - a tech.ml.dataset-friendly fork of Docjure, providing clear entry point at the workbook and sheet level and a way to insert images Excel-clj â­ (act): xl - building Excel spreadsheets from Clojure data in various forms such as trees, tables, and more fxl â­ (act): xl - manipulating spreadsheets with a versatile API for handling various spreadsheet constructs Excel-templates: exp,xl - building Excel spreadsheets from Clojure data combined with an Excel sheet serving as a template xl-parse-clj: exp,xl - converting an Excel workbook to Clojure code  Array programming, linear algebra #\r dtype-next â­ (act): array,native,stat,tensor - abstractions and foundations for working with array-like structures and sequential structures Neanderthal â­ (act): array,gpu,linalg,native - matrix and linear algebra in Clojure tvm-clj (act): array,exp,gpu,linalg,native - bindings to tvm Geometric Algebra (act): linalg,math - A library to do geometric algebra jutsu.matrix: array,gpu,linalg,native - bindigs to ND4J core.matrix: array,cljs,linalg,native - matrix abstractions, supporting diffent backends denisovan: array,gpu,linalg,native - Neanderthal backend for core.matrix  Deep learning #\r Deep Diamond â­ (act): dnn,gpu,native,tensor - infrastructure for tensor computation and deep learning clj-djl â­ (act): dnn,gpu,native,tensor - a wrapper for the Deep Java Library MXNet: dnn - bindings to Apache MXNet, a part of the MXNet project jutsu.ai: dnn - a wrapper for deeplearning4j Cortex: dnn - a deep learning library written in Clojure Flare: dnn - dynamic neural networks in Clojure  Statistics #\r kixi.stats â­ (act): rand,stat,xform - statistics and random sampling using transducers fitdistr â­ (act): stat - fitting distributions  Time series analysis #\r tide: ts - STL and FastDTW algorithms  Bayesian computing \u0026amp; probabilistic programming #\r inferme â­ (act): prob,rand,vis - extensible probabilistic programming in Clojure itself (rather than a language variation), with support for visualizations Gen.clj â­ (act): prob,rand - A stack for generative modeling and probabilistic inference. cmdstan-clj â­ (act): exp - Using the Stan statistical modelling language from Clojure using the CmdStan CLI clj-stan: - A library for calling the Stan language from Clojure (by shelling out to cmdstan). bayadera: gpu,prob,rand,stat - Bayesian computing using the GPU sampling: rand - support srandom sampling of different kinds distributions: prob,rand - random sampling and some basic Bayesian computing for certain families of distributions metaprob: cljs,exp,prob,rand - an embedded languages for probabilistic programming and metaprogramming daphne: exp,prob - a probabilisic programming compiler from Clojure syntax to Pytorch anglican: cljs,prob,rand - a probabilistic programming language written in clojure, that supports a subset of clojure  Random sampling and simulations #\r masonclj â­ (act): rand - a Clojure wrapper of MASON, which is a Java library for discrete-event multiagent simulation and agent-based modeling. dsim.cljc â­ (act): cljs,rand - an event-driven engine for Clojure(script) heavily borrowing ideas from discrete-event simulation and hybrid dynamical systems date-gen (act): rand - randomized date generation supporting CSV output drand: rand - a client to the Drand randomness service  Science #\r emmy â­ (act): - (was SICMUtils) a library for algebra, calculus, differential geometry and physics based on the SICM book by Sussman \u0026amp; Wisdom cljbox2d â­ (act): cljs - a Clojure/Clojurescript wrapper of the Box2D physics engine API  Machine learning #\r scicloj.ml â­ (act): ml - A machine learning platform supporting a large collection of algorithms and pipeline ergonomics clj-ml: ml - machine learning based on wrapping libraries such as the Weka Java library clj-boost: ml - a wrapper for XGBoost propaganda: ml - an implementation of the propagator computational model dvc: ml - A programming language independent tool for ML experiment tracking, Clojure fully supported  Genetic programming #\r Propeller â­ (act): ml - \u0026ldquo;Yet another Push-based genetic programming system in Clojure\u0026rdquo; Clojush (act): ml - an implementation of the Push programming language for genetic programming  Natural Language Processing #\r DataLinguist â­ (act): nlp - a Clojure wrapper for Stanford CoreNLP  Large Language Models and related services #\r Bosquet â­ (act): llm - LLMOps for Large Language Model based applications llama.clj â­ (act): llm - A wrapper of llama.cpp clip.clj â­ (act): llm - A wrapper for clip.cpp for embeddins of images and text Ragcats â­ (act): llm - A set of functions for building LLM applications including RAGs. cohere-clojure â­ (act): llm - An Unofficial port of the Cohere SDK openai-clojure â­ (act): llm - A wrapper of the OpenAI API and Azure OpenAI API openai-api â­ (act): llm - A wrapper of the OpenAI API multi-gpt â­ (act): llm - A wrapper of the Open AI GPT Chat API with conversational memory and WIP agents support vald-client-clj â­ (act): llm - A gRPC client library for the Vald distributed vector database simix â­: llm - Similarity search for Cloure, build on top of hnsw clojurellm-data â­ (act): llm - Dataset curation for fine tuning an LLM for Clojure instructor-clj (act): llm - A library inspired by instructor, making it easy to have structured output from LLMs (using Malli for defining schemas)  Interop #\r clj-polyglot-app â­ (act): interop - A deps-new template to create a polyglot app in Clojure (Clojure, R, \u0026amp; Python) Libpython-clj â­ (act): interop - interop with Python clj-python-trampoline â­ (act): interop - using libpython-clj from an already running python process, without needing any special python builds Libjulia-clj â­ (act): interop - Julia bindings for Clojure ClojisR â­ (act): interop - interop with R and Renjin (R on the JVM) graalvm-interop: interop - interop with FastR (GraalVM\u0026rsquo;s R) rdata: - A Renjin (pure-JVM R) wrapper to allow Clojure programs to easily read R\u0026rsquo;s RData file format from-scala: interop - interop with Scala Interop template project: interop - A project template which configure several interop libraries automaticaly using Docker other R interop libraries  Parallel computing #\r claypoole â­ (act): for,future,pmap - threadpool-based parallel versions of Clojure functions such as pmap, future, and for parallel â­: - parallel-enabled functions, addditional transducers and supporting utilities tesser â­: - a library for concurrent \u0026amp; commutative folds, including some statistical tasks and Hadoop support tech.parallel â­ (act): - parallelization and threading primitives  Distributed computing #\r titanoboa â­ (act): - a fully distributed, highly scalable and fault tolerant workflow orchestration platform onyx â­: - a library for distributed computation in the cloud overseer: - a library for building and running data pipelines  Hadoop #\r Parkour: - Hadoop MapReduce in idiomatic Clojure  Spark #\r geni â­ (act): df - a Spark wrapper sparkling: - a Spark wrapper flambo: - a Spark wrapper  Stream processing #\rKafka #\r jackdaw â­ (act): - a wrapper for Kafka and Kafka Streams kafka.clj â­ (act): - a wrapper for Kafka and Kafka Streams ksml â­ (act): - representing kafka streams topologies as data rp-jackdaw-clj: - various components for interacting with Kafka using Jackdaw  Datasets #\r hdfs-clj â­ (act): - Access to HuggingFace datasets via Clojure  "}).add({id:6,href:"/docs/resources/reading/",title:"Reading",description:"Recommended reading",content:" Here are some suggested reading materials.\nDo you wish to add your tutorial to this list? Do you have any suggestions for this list? - Let us talk!\nScicloj resources #\r The Clojure Data Scrapbook - a community-driven collection of tutorials for the emerging Clojure data stack - contributions are welcome. ðŸ™  Blogs #\r  TechAscent Blog by the group behind a few of the Clojure high-performance and data-analytics libraries (mostly those at techascent, as well as dtype-next and libpython-clj)\n  Clojure Tidy Tuesdays by Kira McLean - Clojure data explorations of datasets shared in the R community\n  Code with Kira - by Kira McLean - in partucular: The Current State of ML in Clojure (2024-04-05)\n  Squid\u0026rsquo;s Blogs by Carin Meier - deep learning, MXNet, Python interop and other technical topics\n  Dragan Djuric - numerical computing, linear algebra, high performance computing and deep learning\n  Atabey Kaygun - math, algorithms, machine learning, and data science topics demonstrated through Clojure and other Lisp dialects - in particular, Graph Algorithms in Clojure with JGraphT (2023-01-14) and many others\n  Thomas-Sojka - data visualization and other topics - in particular: hiccup-d3 - a gallery of Hiccup D3-charts in Clojurescript\n  Georgy Toporkov\u0026rsquo;s Lebenswelt - Data processing, publishing, and other topics - in particular: Dealing with out-of-memory faulty csvâ€™s with Clojure, Duckdb, and Parquet (2024-01-22)\n  Arthur Caillau\u0026rsquo;s Blog - featuring the \u0026ldquo;MXNet made simple\u0026rdquo; series - deep learning from Clojure\n  Christopher Small - discussing the development of Oz, among other things\n  Clojure Goes Fast - overviews tools and practices for profiling and improving performance in Clojure\n  Applied Science blog by Dave Liepmann, Matt Huebert and Jack Rusher - Deep learning, data visualization, data processing\n  Other collections of notes #\r Mentat Collective - documenting an emerging stack of libraries and tools for math, physics, and data visualization  Tutorials #\rGeneral Nextjournal collections #\r  Dieter Komentera - various topics\n  Tomasz Sulej - various topics\n  Alan Marazzi - various topics\n  Carin Meier - mainly Python interop\n  Chris Nuernberger - mainly Python interop\n  Math #\r  Fastmath tutorials\n  Math for clojurists by Alan Marazzi\n  Probabilistic programming #\r gen.clj tutorial  Data processing #\r Tablecloth tutorial  Transducers #\r A general introduction by Amit Ramon  Machine Learning #\rXGBoost #\r clj-boost - A tutorial by Alan Marazzi  Python interop #\r See mainly the growing list of tutorials at Squid\u0026rsquo;s Blogs mentioned above.  Plotting #\r vega-lite example Gallery in EDN by Carsten Behring Fun With Matplotlib by Chris Nuernberger. Panthera tutorials  R interop #\r Clojisr tutorials Clojisr examples with lots of vizualiations, by Tomsaz Sulej and others  Literate programming #\r Clojupyter examples Clay tutorial  Data Visualization #\r vdquil - Examples from Ben Fry\u0026rsquo;s \u0026ldquo;Visualizing Data\u0026rdquo; in quil - by Dave Liepmann  Colors #\r clojure2d.color documentation - path of the clojure2d library  Books #\r  Books by Dragan Djuric about Deep Learning and about Linear Algebra in Clojure - books developed alongside Dragan\u0026rsquo;s work on libraries in this fields\n  Clojure for Data Science by Henry Garner - a bit dated in terms of the stack it presents, but stll relevant in terms of the principles presented\n  Practical Artificial Intelligence by Mark Watson\n  Other collections of resources #\r  Resources for Clojure beginners collected by Dmitri Sotnikov\n  An intro to Clojure by Chris Nuernberger, inviting newcomers, mostly Pythonistas, to some of its core ideas\n  "}).add({id:7,href:"/docs/resources/video/",title:"Video",description:"video resources",content:"Clojure Data Scrapbook accompanying videos #\r 2024-03-30 - Noj - getting started - from raw data to a blog post  Clojure/Conj 2023 #\rA few of the Clojure/Conj talks were dedicated to infrastructure and applications of the emerging Clojure data science stack.\n \u0026ldquo;Vector Symbolic Architectures In Clojure\u0026rdquo; by Carin Meier  \u0026ldquo;High Performance Clojure\u0026rdquo; by Chris Nuernberger  \u0026ldquo;Clojure in the Fintech Ecosystem\u0026rdquo; by Philip Cooper  \u0026ldquo;Real @toms with Clojure!\u0026rdquo; by Thomas Clark and Daniel Slutsky (about Physics research with Clojure) \u0026ldquo;Comparing protein structures with Clojure\u0026rdquo; by Blaine Mooers \u0026ldquo;Clojure for Data Science in the Real World\u0026rdquo; by Kira McLean  reClojure #\rreClojure 2022 #\rScicloj was involved in organizing the reClojure 2022 event. A few of the talks were related to data \u0026amp; science topics.\n Dec. 2nd-3rd, conference talks - playlist  A Scicloj overview by Kira McLean: Data and Clojure: Using Clojure for more than software development - video    reClojure 2021 #\rScicloj joined the London Clojurians in organizing the reClojure 2021 event and its workshops - â­ The following playlists are recommended as an up-to-date look into a few parts of the emerging data-science stack. â­\n Dec. 5th, reClojure 2021 Data Science Special - playlist Dec. 3rd-4th, reClojure 2021 Conference - playlist  A Scicloj overview by Sami Kallinen and Ethan Miller: Clojure Emerging Data Ecosystem - video   Nov., reClojure 2021 Workshops - playlist  reClojure 2020 #\rThe reClojure 2020 conrefnere offered a few data \u0026amp; science talks.\n Dec. 4th-5th, conference talks - playlist  A Scicloj overview Sami Kallinen: How to build a Clojure Data Science Community - video  A pre-conference interview of Sami by Jordan Miller: \u0026ldquo;Sami Kallinen tackles tough questions on building a positive Sci-Cloj community\u0026rdquo; - video      Interviews #\r June 30th, 5pm UTC - Jon Anthony interviewed about Hanami \u0026amp; Saite by Alan Marazzi, Ethan Zane Miller and Vijay Kiran - video April 26th - Chris Nuernberger interviewed by Teodor Heggelund, Tomasz Sulej and Daniel Slutsky - video September 27th - Anthony Khong interviewed by Vijay Kiran, Teodor Heggelund and Daniel Slutsky about Geni - video  Public sessions of dev \u0026amp; study groups #\rreal-world-data #\r Mar 22nd 2024 - meeting 1:  Kyle Passarelli Adham Omran    ds4clj #\rAs of Fall 2022, the planned Data Science for Clojure devs course is delayed. Occaionally, we have ad-hoc exploration or prep meetings. Some recordings are shared publicly.\n Sep 10th, 2022 - NLP in Clojure Session 1: linguistics, spaCy, Libpython-clj Oct 30th, 2022 - NLP in Clojure Session 2: ml pipelines with DVC, Metamorph, scicloj.ml  data-recur #\rIn the data-recur group, Clojure devs are sharing updates and collaborating on tools \u0026amp; libraries of the emerging Clojure data stack.\n July 29th, 2022 - clojure.walk, community updates   Aug 27th, 2022 - Clojask, columns for Tablecloth Sep 30th, 2022 - Meander Nov 5h, 2022 - Intro to Tablecloth  visual-tools #\rThe visual tools group is about creating collaborations across differnent tooling projects for data visualization and literate programming.\n Feb. 4th, 2022 - a first meeting of the visual-tools group Feb. 19th, 2022 - focusing on compatibility across tools Mar. 5th, 2022 - monthly - updates of ongoing projects Mar. 25th, 2022 - study session about Clerk Apr. 2nd, 2022 - monthly - updates of ongoing projects May 6th, 2022 - monthly - updates of ongoing projects May 27th, 2022 - a deep dive into Saturn June 3rd, 2022 - monthly - updates of ongoing projects: data cookbook, goldly studio, re-frame state management July 2nd, 2022 - monthly - updates of ongoing projects: clj-tiles, Obsidian Wielder, Cardigan Bay, Platypub Aug. 5th, 2022 - monthly - focusing on Oz Sep. 2nd, 2022 - monthly - tooling for learning resources, a peek into Data Rabbit Sep. 9nd, 2022 - special meeting - Data Rabbit Oct. 14th, 2022 - interactive visualizations: Shiny, Clojurescript Bayesian animations Oct. 23th, 2022 - knowledge management with play.teod.eu, a common ground for notes with Kindly Nov. 27th, 2022 - Calva Notebooks \u0026amp; Portal Apr. 1st, 2023 - various updates May 27th, 2023 - Mosaic and other updates Dec. 1st, 2023 - various updates: MetaREPL, Timespace Oracle, Meyvn templates, Kindly, Clay, Claykind Feb. 25th, 2024 - ggplot study session 1 Mar. 17th, 2024 - ggplot study session 2 Apr. 7th, 2024 - ggplot study session 3 Apr. 26th, 2024 - badspreadsheet \u0026amp; HTMX  llm meetups #\rThe goal of this series of meetups is to support our learning, as a community, of the new landscape of ideas around large language models.\n May 26th, 2023 - Introduction June 16th, 2023 - Prompt engineering and managing embeddings June 17th, 2023 - LLMOps with Bosquet July 14th, 2023 - Transformer-based generative LLMs Sep 24th, 2023 - Library overviews Nov 17th, 2023 - Implementing research papers with Bosquet  ml-study #\rThe ml-study group (on hold as of Feb. 2022) is about practicing the usage of the emerging Clojure data science stack. Most of its recordings have been shared internally at the Zulip chat. One of them was made public.\n Feb 28th 2021, 19:00 UTC - a public sessoin of the ml-study group about Notespace and Hanami - video  jointprob #\rJointprob is a study community for Bayesian statistics and probabilistic modelling, initiated by Scicloj. Most of its meetings have been recorded and shared internally. Some meetings are shared publicly.\n Aug 26th 2023 - Hierarchical Models with David MacGillivray  Scicloj talks #\r2021 #\r Feb 28th, 13:00 UTC - Anthony Khong' talk about fxl: a composable, data-oriented spreadsheet library - video Jan 28th, 4pm UTC - Alan Dipert: Common Lisp for the Curious Clojurian - details - video - slides  2020 #\r Dec 16th, 14:00 UTC (note the date change) - Nikita Prokopov about Skija \u0026ndash; graphics in the JVM - Video Dec 2nd, 14:00 UTC - Sicmutils #1 - geometry, symbolic math, and physics in Clojure(script) - background - video November 21st, 16:00 UTC - Joanne Cheng - Clojure in Geography #2 - video November 7th, 8pm UTC - Vlad Protsenko about Reveal: Read Eval Visualize Loop and cljfx - video November 1st., 6pm UTC - Clojure and data science in healthcare: Sivaram Arabandi \u0026amp; Pier Federico Gherardini - video October 3rd, 1pm-3pm UTC - Will Cohen - Clojure in Geography #1 - video September 26th, 1pm-2:30pm UTC - talks and discussion of machine learning libraries - video August 30th, 5pm-6:30pm UTC - public meeting with lightning talks and chat - video March 29th, 2pm-6pm UTC - COVID-19 online Hackathon - details here and here - video not published yet March 26th, 5pm-7pm UTC - Simon Belak - Exploratory analysis: automation, augmentation, and building tools for thought - video coming soon March 21st, 2pm-6pm UTC - COVID-19 online Hackathon - details here and here - video January 9th, 3pm-5pm UTC - Ludovic CourtÃ¨s - Guix-Jupyter reproducible notebooks - video - slides - recap  2019 #\r October 28th, 6pm UTC - Tommi Reiman - Malli - video October 14th, 3pm UTC - Konrad KÃ¼hne - Datahike - video September 12th, 5pm UTC - Daniel Slutsky - R-interop - video August 29th, 5pm Jon Anthony - Hanami+Saite - video August 9th, 5pm UTC - Christopher Small - Oz - video Jul 18th, 5pm UTC - Chris Nuernberger - Libpython-clj - Alan Marazzi - Panthera - video June 20th, 2pm UTC - Martin Kavalar - Nextjournal - video May 15th, 10pm UTC - Carin Meier - Clojure MXNet - video April 15th, 3pm UTC - Chris Nuernberger - Tech.ml - video - transcript  Status reports #\rVisual-tools #\r Mar. 13th, 2022, Visual tools compatibility - video  Clay #\r Dec. 17th, 2023, How to code a blog with Clay v2 (teaching Clay\u0026rsquo;s API, config, and Cursive integration) - video Dec. 17th, 2023, Clay v2 pre-release with CIDER - video Dec. 16th, 2023, Clay v2 pre-release with Calva - video  Notespace #\r Nov. 29th, 2021, Notepace v4 status - video Aug. 19th 2021, Notespace v3 status - video Aug 24th, 2020, Notespace v3 status - video  Recommended talks on other grouns and channels #\rLondon Clojurians #\r June 9th, 2021 - Chris Nuernberger - High Performance Data With Clojure - video Oct. 10th, 2023 - Chris Nuernberger - High Performance Functional Data Science - video Oct. 25th, 2023 - Chris Badahdah - Portal Internals - video Dec. 12th, 2023 - Kira McLean, Timothy Prateley, \u0026amp; Daniel Slutsky - Cooking Up a Workflow for Data - video April. 30th, 2024 - Kira McLean - From data to insights: Clojure for data deep dive - video May 14th, 2024 - Dragan Djuric - Programming with Linear Algebra: Hello World - video  Boston Clojure #\r July 26th, 2021 - Daniel Slutsky - Data Science in Clojure: Almost Ready, Already Useful - video  Func Prog Sweden #\r Mar 22nd, 2023 - Mey Beisareon - Catch \u0026lsquo;em All: Efficient Massive Tabular Data Handling with Tablecloth - video  twiml #\r July 20th, 2020 - Panel: The Great Language (Un)Debate - video - a panel discussion of various languages and paradigms, with Chris Nuernberger representing Clojure  "}).add({id:8,href:"/docs/resources/audio/",title:"Audio",description:"audio resources",content:"Recommended podcast conversations\nClojureStream #\rE72 Data Processing with Chris Nuernberger (part 1)\nE73 Data Processing with Chris Nuernberger (part 2)\nE74 Linear Algebra with David Pham\nE78 Data Science with Daniel Slutsky\nCognicast #\r2017-05-31 Episode 125 - Chris Nuernberger: deep learning (from the times of Cortex)\n2020-06-29 Episode 153 - Chris Nuernberger: [Libpython-clj](, etc.), etc.\n2020-10-25 Episode 154 - Dragan Djuric: deep learning, etc.\ndefn #\r#86 Kira McLean\nThe REPL #\r2018-12-05 13: High performance Clojure numerics with Chris Nuernberger\n2019-03-20 20: Clojure MXNet with Carin Meier\n2019-06-19 25: Dragan Djuric on Neanderthal\n2019-11-08 31: Joel Holdbrooks on Meander\n2023-01-13 47: Executable textbooks with Sam Ritchie\nSoftware Unscripted #\rDec. 2023 Making JITted Code Faster with Chris Nuernberger\n"}).add({id:9,href:"/docs/community/groups/ds4clj/",title:"{on hold} ds4clj: a data science course for Clojure devs",description:"A data science course for Clojure devs",content:" \r\r Following broad support on Clojureverse and Reddit conversations and elsewhere, we have been planning a data-science course for Clojure devs during 2023.  For various reasons of community priorities, this project was delayed. As of May 2024, we are reconsidering a revised version, which is probably a semi-structured series of talks alongside the more hands-on real-world-data group.\nThe content below is the old 2022-2023 draft.\nexploration meetings preparing for the course #\r 2022-07-24, initial brainstorming - event 2022-08-06, prep meeting about R \u0026amp; Tidyverse - event 2022-09-10, NLP study session 1 - summary \u0026amp; video 2022-10-30, NLP study session 2: Predict real vs. fake disaster tweets with DVC, Clojure and Python - summary \u0026amp; video 2022-11-05, an intro to table processing with Tablecloth - a session of the data-recur group - summary \u0026amp; video  goals #\r provide Clojure devs with basic theory, practices, and tools for common data science tasks;  also welcome open-minded people who are new to Clojure;   create learning resources for future use; encourage Clojurians to become active contributors to the emerging stack.  requirements #\r  at least one of the following:\n basic knowlede of Clojure a very open mind towards new programming languages    being ready to put a few hours a week into learning and practice, for a few months\n  chat #\r We\u0026rsquo;ll use a dedicated stream at the Clojurians Zulip chat. Stream: ds4clj It is recommended to follow a few of the other chat streams.  time #\r We\u0026rsquo;ll have a class once a month. We may have practice meetings in between. Each class is 3 hours, containing a lecture, a short break, and then discussion and Q\u0026amp;A.  recording #\r The meetings will be recorded and shared at the Clojurians Zulip chat. Some parts of the recordings (e.g. the lecture) will be shared publicly.  homework #\rHomework will be composed of:\n exercises on class topics personal projects (as individuals or in small groups) \u0026ndash; for example:  exploring datasets reproducing previously publushed research contributing to the stack of relevant libraries contributing to documentation    recommended resources #\rðŸ“– [Clj4BT] Clojure for the Brave and True by Daniel Higginbotham\nThis is a great intro to Clojure.\nIt is useful for those who need a refresh with the language, or are new to it.\nNote: Chapter 2 suggests a specific development environment using Emacs (and is also a bit outdated). Emacs is wonderful, but it is not required for learning Clojure. Please reach out for help you wish to learn the book with another environment.\nðŸ“– [R4DS] R for Data Science by Wickham and Grolemund\nThis is a good intro to the R language and its use in basic data-science tasks. It uses the Tidyverse collection of R packages and the so-called \u0026ldquo;tidy\u0026rdquo; approach, which is common in today\u0026rsquo;s R community.\nWe will use parts of it a basic intro to R. Knowing some R would make participants more independent in approaching study resources on their own. Python could have been another option, but we prefer R, since its ecosystem is arguably more in harmony with the functional approach and with expressing statistical ideas.\nðŸ“– [Clj4DS] [Clojure for Data Science](https://www.packtpub.com/product/clojure-for-data-science/9781784397180** by Henry Garner\nThis is an excellent intro to data science topics, but it uses Clojure libraries which are not actively developed anymore.\nIt will be used for a few of the case studies, that we will adapt to this course.\nlist of topics (tentative) #\rlanguage #\r(mostly self learning)\n Clojure R  from today\u0026rsquo;s brainstorming:\ntheory \u0026amp; methods #\r(very basic intros)\n hello world: a typical workflow reshaping data (the \u0026ldquo;tidy\u0026rdquo; notion) correctness: testing, reproducibility descriptive statistics frequentist statistical inference supervised learning: principles \u0026amp; workflow, regression, classification working with tree-structured data probabilistic modelling through Bayesian statistics unsuprevised learning: clustering, dimension reduction linear algebra deep networks nlp async data streams graph data  libraries \u0026amp; tools #\r(some introduced briefly, some more thoroughly)\n tables: tablecloth, tech.ml.dataset arrays: dtype-next transducers: xforms, injest correctness (schemas): malli data vis \u0026amp; notebook tooling: portal, oz, clerk, clay data vis grammars: hanami, cljplot? math stats: fastmath, kixi.stats machine learning algorithms \u0026amp; pipelines: scicloj.ml interoperation w/ other languages: libpython-clj, clojisr Bayesian statistics: inferme, clj-stan tree data: clojure.walk, core.match, specter, meander, tupelo data ingestion: jdbc-next?, some web scraping, arrow? linear algebra, deep learning: neanderthal, deep-diamond parallel computing: geni, clojask nlp: datalinguist?, spacy through interop graph data: loom, asami, neo4j?  course plan (very tentative) #\r   month topic libraries homework      core topics           1 common workflow tablecloth, fastmath, hanami, learn some R and Clojure     scicloj.ml          2 descriptive stats, fastmath, kixi.stats apply to a real-world dataset    frequentist stats           3 data visualization hanami, cljplot? apply to a real-world dataset         4 arrays \u0026amp; tables dtype-next, tech.ml.dataset, apply to a real-world dataset,     tablecloth run some speed comparisons         5 basic supervised learning workflow, scicloj.ml, malli reproduce some kaggle notebooks    reproducibility, tests           6 probability, Bayesian stats inferme, clj-stan reading in Statistical Rethinking,      reproducing some examples         7 advanced supervised learning workflows scicloj.ml reproduce some kaggle notebooks,      explore variations \u0026amp; improvements         8 unsupervised learning fastmath, scicloj.ml reproduce some kaggle notebooks,      explore variations \u0026amp; improvements         9 python and R interop libpython-clj, clojisr go through some tutorials by      interop          specialized topics           10 working with tree-sructured data, clojure.walk, specter, meander, scrape \u0026amp; analyse some    web scraping hickory unstructured data         11 linear algebra, basic image processing neanderthal process some images         12 deep learning deep diamond reproduce some tutorials         13 async data streams xforms, kixi.stats analyse some user events         14 natural language processing datalinguist, analyse some texts,     spaCy through interop write rules to capture intents         15 graph data loom, asami, neo4j? analyse some graph data         16 big datasets geni, clojask, tech.ml.dataset query and analyse a big dataset,      run some speed comparisons          "}).add({id:10,href:"/docs/community/groups/interop/",title:"{coming soon} a dev group about interop and transpilers",description:"a dev group about interop and transpilers",content:"coming soon\n In this group, we wish to explore projects such as ClojisR\u0026rsquo;s code generation, a similar layer we have at Wolframite, and general transpilers such as Kalai and Std.lang.\nWe hope to find some common ground and principles across these projects.\nAs of May 2024, we are not organizing this group yet, but hopefully it will begin later during this year.\n"}).add({id:11,href:"/docs/community/groups/data-recur/",title:"data-recur: recurring updates \u0026 discussions around building the emerging data stack",description:"recurring updates \u0026 discussions around building the emerging data stack",content:" \r\rThis group is a space for recurring updates \u0026amp; discussions around the emerging Clojure stack for data processing, analysis, and visualization.\n 2024-06-29 - meeting 5: Datajure - ðŸ“† event 2022-11-05 - meeting 4: Tablecloth - ðŸŽ¥ summary \u0026amp; video 2022-09-30 - meeting 3: Meander - ðŸŽ¥ sumamry \u0026amp; video 2022-08-27 - meeting 2: Clojask, columns for Tablecloth, ds4clj, and more - ðŸŽ¥ summary \u0026amp; video 2022-07-29 - meeting 1: clojure.walk, community updates - ðŸŽ¥ summary \u0026amp; video  Future topics:\n Machine learning: Tablecloth, scicloj.ml, Metamorph Interop with a Python array library, e.g. Tensorflow, JAX, Xarray Going deeper into Meander General data science workflow with relevant tools and libraries  Organizers: Ethan Miller \u0026amp; Daniel Slutsky (please reach out at the Clojurians Zulip)\nFrequency of meetings: All-hands monthly meetings + ad-hoc meetings on specific topics\nChat stream: #data-recur\n"}).add({id:12,href:"/docs/community/groups/llm-meetups/",title:"scicloj-llm-meetups: public meetings exploring the princples and use of large language models",description:"Scicloj LLM meetups",content:"ðŸ“…Follow our meetings on the Clojure Calendar FeedðŸ“…\n\r\rThe goal of this series of meetups is to support our learning, as a community, of the new landscape of ideas around large language models.\nSome of the content here is specific to the Clojure ecosystem (e.g., discussing the use of LLMs from Clojure), but many parts of it could be helpful and interesting to broader audiences.\nBlog posts #\r2023-09-29, Following our first five LLM meetups\nMeetings #\rOur meetings are announced on the Clojure Calendar Feed.\nMost meetings will be recorded and shared publicly (ðŸŽ¥ Playlist).\n  #1 2023-05-26, Intro to LLMs - ðŸŽ¥ summary \u0026amp; recording\n Martynas MaciuleviÄius provided an overview of the topic, introducing a few of the basic ideas behind LLM.    #2 2023-06-16, Intro to prompt engineering - ðŸŽ¥ summary \u0026amp; recording\n Irfan Nurhadi Satria demonstrated some of the common methods of prompt engineering from Clojure. Daniel Slutsky added a brief introduction to the use of embeddings and vector databases.    #3 2023-06-17, LLMOps with Bosquet - ðŸŽ¥ summary \u0026amp; recording\n Å½ygimantas Medelis discussed the currently emerging tooling ecosystem and then presented Bosquet, dived in a bit into its internals (e.g., the use of Slemer and Pathom), and discussed future directions.    #4 2023-07-14, Architectures and ideas behind transformer-based generative LLMs - ðŸŽ¥ recording\n Dimid Duchovny briefly overviewed the history of LLM models and explained some of the core ideas behind them.. Then, he demisntrated using LLMs locally from Python, as well as through the OpenAI API.    #5 2023-09-24, Library overviews and selected discussions - ðŸŽ¥ recording (summary coming soon)\n Projects on the agenda:  Clojure LLM Project Update multi-gpt Cohere Clojure SDK llama.clj Bosquet updates      #6 2023-11-17, Implementing research papers with Bosquet - ðŸŽ¥ summary \u0026amp; recording\n Å½ygimantas Medelis will demonstrate how a couple of recent research papers can be implemented using Bosquet.    Other Upcoming meetups:\n Selected discussion topics Use cases and experiments \u0026ndash; short talks llamma.clj deep-dive    Meeting videos #\rPlaylist at the Scicloj channel\nClojure activity around LLMs #\rHere we list a few exciting projects that various Clojure groups and individuals have been working on.\n At the #clojurellm channel in the Clojurians Slack, a group of Clojurians is working on helping LLMs understand Clojure. This channel has been very active in sharing various relevant updates about the LLMs landscape. Ryan Robitaille has been sharing experiments connecting LLMs to dataflow UIs (Rabbit Remix). Matthew Downey has created rendergpt, a Chrome extension for rendering structured output from ChatGPT interactively.  Related past meetups #\r Use of LLMs  2023-04-01, a short demo in meeting 17 of the visual-tools group  Matthew Downey presented rendergpt.     NLP (not LLMs)  2022-09-10, NLP study session 1 - ðŸŽ¥ summary \u0026amp; video  Dimid Duchovny gave an intro to Linguistics. Daniel Slutsky demosntrated using spaCy from Clojure for text classification. Carsten Behring added some comments about the broader picture of interop and machine learning in Clojure.   2022-10-30, NLP study session 2: Predict real vs. fake disaster tweets with DVC, Clojure and Python - :video: ðŸŽ¥ summary \u0026amp; video  JoÃ£o Santiago gave a short intro intro to DVC. Carsten Behring demonstrated of a real-world NLP pipeine and discussed some promising directions in building machine-learning pipelines with DVC, Clojure, Python, and Metamorph / scicloj.ml.      "}).add({id:13,href:"/docs/community/groups/jointprob/",title:"Jointprob: a probabilistic modeling and Bayesian statistics study community",description:"Probabilistic modeling and Bayesian Statistics study community",content:" \r\rJointprob is a study community for probabilistic modeling and Bayesian statistics, running since August 2022.\nEven though the community was initiated by Scicloj \u0026ndash; a community for data science in Clojure \u0026ndash; this study community is not focused on any single technology or programming language. Rather, it is open to people of diverse technical backgrounds and will continually seek dialogue and mutual inspiration across languages and technologies.\nAs of June 2024, we are planning to renew the meetings after a break of a few months. Probably, it will be a new reading journy with a new choice of book.\nGoal #\rThis is a long-term project aiming to create a space for Bayesian practitioners, as well as aspiring ones, to learn \u0026amp; explore together and support each other.\nWe wish to be inclusive to people of diverse backgrounds and thus create a common ground where we can broaden our perspectives and inspire each other.\nJoining #\rIt is never too late to join us \u0026ndash; we will help you to catch up.\nPlease use the Joining Jointprob form to join the community, to be added to our calendar events, or to update your preferences and personal information.\nAlso, you are always invited to write to us.\nSchedule #\rOur current journey: standalone sessions #\r 2023-08-16/26: Hierarchical Models with David MacGillivray - blog post - ðŸŽ¥ video ðŸŽ¥ 2023-09-20/30: Probability basics for Bayesian analysis - blog post - recording will be shared soon  Our second reading journey: Bayesian Modeling and Computation #\r 2023-01-07: Bayesian Modeling and Computation: meeting the book\u0026rsquo;s author Ravin Kumar and brainstorming our new reading journey \u0026ndash; see the blog post. 2023-01-21: Discussing our reading plans 2023-02-8/11: a motivating intro \u0026ndash; Bayesian Methods for Hackers chapter 1 2023-02-15/18: probability \u0026amp; statistics review \u0026ndash; Think Stats 2e chapters 1-6 2023-02-22/25: starting the main journey \u0026ndash; Bayesian Modeling and Computation chapter 1 (mostly focused on section 1.1) 2023-03-8/11: Bayesian Modeling and Computation chapter 1: exercises and section 1.4 (priors) 2023-03-22/25: Bayesian Modeling and Computation chapter 2 2023-04-05/08: Bayesian Modeling and Computation chapter 2, mostly section 2.5 2023-04-19/22: Bayesian Modeling and Computation chapter 3 2023-05-3/6: Bayesian Modeling and Computation chapter 3, starting from section 3.3 2023-05-17/20: Bayesian Modeling and Computation chapter 4 2023-05-31/06-03: Tensorflow Probability 2023-06-14/17: selected dopics from chapters 5,6,7 of Bayesian Modeling and Computation 2023-06-28/07-01: chapter 8 of Bayesian Modeling and Computation 2023-07-12/15: chapter 9 of Bayesian Modeling and Computation  Our first reading journey: Statistical Rethinking #\r 2022-07-22, initial brainstorming - event 2022-08-06, prep meeting about R \u0026amp; Tidyverse - event (joint event with the ds4clj course) 2022-08-15 - beginning of regular meetings (see the Groups below). 2022-08-15/17/19/20, Session 1: Statistical Rethinking chapter 1, R4DS sections 1-4 2022-08-31, 2022-09-2/3, Session 2: Statistical Rethinking chapter 2 2022-09-14/16/17, Session 3: chapter 2 - review of main notions and a look into exercises 2022-09-28/09-30/10-01, Session 4: chapter 3 2022-10-12/14/15, Session 5: chapter 4 2022-10-26/28/29, Session 6: chapter 4 - continued 2022-11-9/11/12, Session 7: chapter 5 2022-11-23/25/26, Session 8: chapter 6, personal regression projects 2022-12-7/9/10, Session 9: more about DAGs (section 6.4), chapter 7 2022-12-24, Session 10: information theory \u0026amp; information criteria - reporting on personal reading  Past Agenda #\rIn the past, we have been meeting biweekly (in groups) to discuss our joint reading and projects.\nOur joint reading journeys have been around the first half of Statistical Rethinking by Richard McElreath, and then around Bayesian Modeling and Computation in Python by Osvaldo A. Martin, Ravin Kumar and Junpeng Lao.\n Present Agenda #\rCurrently, we meet about once a month around standalone talks of various topics. We also encourage individual and small-group projects, that participants share and present in the sessions.\nCalendar events #\rPlease refer to the Joining section to join our calendar events.\nChat #\rThe community uses Zulip, an open-source chat platform. In some other groups we\u0026rsquo;ve been running, we\u0026rsquo;ve found it useful for chat, in-depth discussion threads, and knowledge management.\nOur Zulip organization is jointprob.zulipchat.com.\nYou may wish to learn a little bit about the concepts of Zulip streams and topics. Note that all streams and topics (and even single messages) have URLs, that you can open at separate tabs in your browser.\nIt would be wonderful to present yourself at the personal intros stream, preferably as a new topic thread.\nVideo platform #\rFor video meetings, we currently use Zoom. The link is shared in the calendar events.\nRecordings #\rSome parts of the sessions are recorded and shared internally in the Zulip chat. Possibly, we will also share some recorded parts publicly.\nProjects #\rParticipants take on projects as individuals or in small groups.\nExample projects:\n read an article and share it with the group reimplement an example we have learned using a different technology explore a dataset with the methods learned  Recommended background #\rParticipants are assumed to have some relevant knowledge.\nTo appreciate the content we are studying, it is recommended to have the following:\n basic knowledge of probability and statistics (say, college-level intro courses) programming experience in any language (a few months) experience exploring data an open mind  If you are not sure whether this journey fits your background, please write to us. We can think together.\nPrinciples #\rThe following core principles are typical of Scicloj study groups.\nNo experts. We do not assume that anybody is an expert in the field. We come to learn together with a student mindset.\nA clear path. We will be very thoughtful about the agenda and where we wish to go. We will continually rethink and adapt our pathway going there.\nConfused together. It is just fine to be confused. We will be there together and seek clarity together.\nBeing active. We encourage members to learn independently and take on projects. In a sense, its purpose is (also) to support those individual journeys.\nMutual curiosity. We make serious efforts to be inclusive to participants of various backgrounds. The different perspectives of our friends are part of what we wish to learn.\nContact #\rPlease reach out:\n scicloj@gmail.com Daniel Slutsky at the chat  "}).add({id:14,href:"/docs/community/groups/probabilistic-modelling-study-group/",title:"{renamed} probabilistic modelling study group",description:"{renamed} probabilistic modelling study group",content:" This group has been renamed as jointprob.\n"}).add({id:15,href:"/docs/community/groups/",title:"Dev \u0026 study groups",description:"The various dev groups and study groups organized by Scicloj",content:"Some parts of the Scicloj activity are driven by regular meetings in various groups.\nSome of these meetings are public and shared at the Clojure calendar feed. Some study groups such as Jointprob have their own spaces for sharing events.\n"}).add({id:16,href:"/docs/community/groups/real-world-data/",title:"real-world-data: a space to discuss your data and science projects in Clojure",description:"The real-world-data group",content:"The real-world-data group is about the use of Clojure for data and science problems.\nSchedule #\rThe group meets regularly on Fridays, 17:00 UTC time zone. Please let us know if you wish to join but the time does not work. We may adjust it.\n June 28th, 2024 - meeting 8 - topic: high-performance numerics (cont.) June 14th, 2024 - meeting 7 - topic: high-performance numerics using Neanderthal May 31th, 2024 - meeting 6 - focus topic: Intro to linear algebra with applications using Neanderthal - a revised walkthrough will be shared publicly  If you wish to present or discuss anything, please let us know. The agenda is updating gradually in the group\u0026rsquo;s Zulip chat.   May 17th, 2024 - meeting 5 May 3rd, 2024 - meeting 4 April 19th, 2024 - meeting 3  publicly shared recording: ðŸŽ¥ Bayesian Statistics with Stan by Daniel Slutsky   April 5th, 2024 - meeting 2 March 22th, 2024 - meeting 1  publicly shared recordings: ðŸŽ¥ Kyle Passarelli ðŸŽ¥ Adham Omran followup tutorial: ðŸ““ chicago bike trips followup video: ðŸŽ¥ noj - getting started - from raw data to a blog post    Goal #\rThis group is a space for individuals, companies, academic groups, and organizations to share their experiences and support each other in using Clojure for data \u0026amp; science projects.\nData analytics, machine learning, AI, data engineering, scientific computing, and data visualization are all welcome.\nIt is a safe space for sharing successes, troubles, problems, hopes, and doubts.\nParticipating #\râ­ It is never too late to join this group. â­\nIf you wish to use Clojure for a data or science project and prefer not to be alone in that journey, this group is for you.\nWe will also assume that you either know some Clojure or have a serious intention to learn it.\nTo join, please reach out to us by contacting Daniel Slutsky at the Clojurians Zulip chat, or ar the various Scicloj ways of contact. We will think together about whether this group fits your path.\nSessions #\rAs a group, we will have biweekly sessions to discuss our ongoing projects. Participants will bring their own data \u0026amp; science problems to the sessions and actively work on them between sessions.\nSome of the time will be dedicated to learning relevant practices, ideas, and technical topics.\nWe will also have one-on-one or small-group sessions to support individual journeys.\nRecordings #\rThe sessions will be partially recorded.\nMost of the recordings will not be shared publicly but rather internally as a tool for us to catch up and recall our past discussions. When recordings are planned to be made public, we will first check with all participants.\nPairing #\rIn the group, we will seek opportunities of collaborations.\nA scientist may wish to pair with a Clojure engineer and explore something together, a Clojurian person may be curious about joining a scientific project, etc. We will be looking for such cases and try to help in matching them.\nContributing #\rIn your projects using the emerging Clojure stack, there will often be opportunities to contribute back to the libraries you use. We will encourage that and help you in considering about fruitful directions and connecting with the relevant library authors.\nWe will highly encourage contributing documentation and tutorials and will use the Clojure Data Scrapbook as a central space for such content.\nChat #\rThe group will use the Clojurians Zulip chat. Specifically, the #real-world-data stream.\nOld timeline (archive) #\r Feb. 25th 2022 - two special sessions we had a while back - announcement (recorded but never published) late June 2023 - initial survey (then the project went on hold) March 2024 - starting the group\u0026rsquo;s regular path  "}).add({id:17,href:"/docs/community/groups/visual-tools/",title:"visual-tools: regular updates \u0026 discussions around building visual tooling",description:"The visual-tools group",content:"ðŸ“…Follow our meetings on the Clojure Calendar FeedðŸ“…\nThe goal of this group is to create collaborations in learning and building Clojure tools data visualization, literate programming, and UI design.\nThe authors of several actively developed tools have been involved in offering talks and collaborating in this space (Chlorine, Clover, Calva and its Notebooks, Portal, Viscous, Sidebar, Nette, Fabricate, Omni-trace, Oz, Saite, Notespace, Clay, Claykind, Goldly, Saturn, clt-tiles, Obsidian Wielder, Cardigan Bay, Platypub, Data Rabbit, Clerk, Mosaic, MetaREPL, Meyvn, badspreadsheet, Noj, ggclj, Space-Age, etc.).\nOur meetings are announced on the Clojure Calendar Feed.\n  Upcoming mini-series (TBD): R and data visualization workshops for Clojurians - please reach out if you are interested\n  Upcoming meeting (TBD): reading in Leland Wilkinson\u0026rsquo;s The Grammar of Graphics\n  Meeting 26 (June 16th 2024): Visual-tools meeting 26 - Gemini, Space-Age, protocols from the REPL - ðŸŽ¥ recording coming soon\n  Meeting 25 (June 7th 2024): keg-party - ðŸŽ¥ recording coming soon\n  Meeting 24 (Apr. 26th 2024): badspreadsheet \u0026amp; HTMX - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 23 (Apr. 7th 2024): ggplot study session 3 - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 22 (Mar. 17th 2024): ggplot study session 2 - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 21 (Feb. 25th 2024): ggplot study session 1 - ðŸŽ¥ summary \u0026amp; recording\n  Meetings 20 (Dec. 1st 2023): Various updates - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 19 (July 7th 2023): Electric - ðŸ“† event (log in to Clojureverse to view)\n  Meeting 18 (May 27th 2023): Mosaic and other updates - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 17 (April 1st 2023): various updates - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 16 (Nov. 19th 2022): Calva Notebooks and Portal - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 15 (Oct. 23th 2022): a common ground for notes with Kindly - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 14 - special meeting (Oct. 20th 2022): Clerk workshop - event (not recorded)\n  Meeting 13 - monthly (Oct. 14th 2022): Interactive visualizations: Shiny, Shadow-cljs, Clay - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 12 - special meeting (Sep. 9h 2022): Data Rabbit - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 11 - monthly meeting (Sep. 2th 2022): tooling for learning resources - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 10 - monthly meeting (Aug. 5th 2022): Oz - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 9 - general monthly (July 2nd 2022): clj-tiles, Obsidian Wielder, Cardigan Bay, Platypub - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 8 - general monthly (June 3rd 2022): data cookbook, goldly studio, re-frame state management - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 7 - a deep dive into Saturn (May. 27th 2022) - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 6 - general monthly (May. 6th 2022) - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 5 - general monthly (Apr. 2nd 2022) - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 4 - studying Clerk internals (Mar. 25th 2022) - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 3 - general montlhy meeting (Mar. 5th 2022) - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 2 - compatibility across tools (Feb. 19th 2022) - ðŸŽ¥ summary \u0026amp; recording\n  Meeting 1 - the beginning (Feb. 4th 2022) - ðŸŽ¥ [summary \u0026amp; recording](https://clojureverse.org/t/visual-tools-meeting-1-summary-video/**.\n  Meeting videos Playlist at the Scicloj channel\nOrganizers: Lukas Domalga, Kira McLean, Daniel Slutsky (please reach out at the Clojurians Zulip)\nFrequency of meetings: All-hands meeting roughly every month + ad-hoc meetings of sub-groups on specific topics\nChat stream: #visual-tools at Clojurians Zulip and at Clojurians Slack\nResources: You are invited to add your experiments and notes.\n  relevant tools and libraries\n  scicloj/visual-tools-experiments - repo for collaboration.\n  common notes - from meetings, etc.\n  background - the visual tools session at the re:Clojure Data Science Special (Dec. 5th 2021), overviewing some of the relevant tools in the field\n  Video status reports:\n Mar. 13th, 2022, Visual tools compatibility - describing the Portal-Clerk-Kindly-nREPL experiment    "}).add({id:18,href:"/docs/community/groups/ml-study/",title:"{on hold} ml-study: practicing the use of the emerging stack",description:"The ml-study group",content:"(this group is on hold)\nThe ml-study group has been a space for regular meetings for practicing the usage of the emerging Clojure data science stack.\nIt has been serving us not only in learning, but also in testing the emerging stack and creating a collection of usage examples.\nOrganizer: Daniel Slutsky (please reach out at the Clojurians Zulip)\nChat stream: #ml-study\n"}).add({id:19,href:"/docs/community/groups/sci-fu/",title:"{on hold} sci-fu: regular discussions of various dev projects",description:"The sci-fu group",content:"(this group is on hold)\nThe sci-fu (Scicloj foundations) has been a space for regular discussions of various dev projects.\nIn a sense, it is a study group where we learn how to contribute to the ecosystem \u0026ndash; For a few of us, sci-fu has been a place to discuss our first steps as open-source contributors.\nIn another sense, it is a dev group where we discuss common priorities, share our progress and challenges, and explore future directions.\nTypically, each session has one or two main topics, that we dive into together. Sci-fu has been a place for us to learn some of the fundamental building blocks of the emerging Clojure data stack, such as the dtype-next library for high-performance data.\nOrganizer: Ethan Miller (please reach out at the Clojurians Zulip)\nTypical time of meetings: on hold at the moment\nChat stream: #sci-fu\n"}).add({id:20,href:"/docs/community/groups/sicmutils/",title:"{on hold} sicmutils: studying the sicmutils library, physics, and geometry",description:"The sicmutils group",content:"(this group is on hold)\nThe sicmutils group has been studying the Sicmutils computer algebra system and the SICM book, and discussing various projects by group members around the topics of math and physics in Clojure.\nIts explorations have affected the development of some of our tools and libraries for data-visualization and literate programming, among other things.\nOrganizer: Daniel Slutsky (please reach out at the Clojurians Zulip)\nTypical time of meetings: ad hoc meetings by group members' initiatives\nChat stream: #sicmutils\n"}).add({id:21,href:"/docs/community/groups/wolfram-clojure-bridge/",title:"{on hold} wolfram-clojure-bridge: discussing the usage and development of the bridge to Wolfram Language",description:"The Wolfram-Clojure bridge group",content:"This 2022 group has been discussing the usage and development of the bridge to Wolfram Language.\nWe used to meet on the last Thursday of every month, and spend the time with overviews of new developments, discussion of language design and library design, and explorations of the Wolfram Language ecosystem.\nThough the regular group meetings have been discontinued, the work and discussion of Wolframite are ongoing. See the #wolfram-clojure-bridge stream at the Clojurians Zulip chat.\nFor more background about the project, please see the Dec. 5th 2021 talk of Pawel Ceranka.\n"}).add({id:22,href:"/docs/community/",title:"Community",description:"Getting to know the Scicloj community",content:""}).add({id:23,href:"/docs/resources/",title:"Resources",description:"Resources for data science in Clojure",content:""}).add({id:24,href:"/docs/",title:"Docs",description:"Docs Doks.",content:""}),search.addEventListener('input',b,!0);function b(){var b,e;const d=5;b=this.value,e=a.search(b,{limit:d,enrich:!0});const c=new Map;for(const a of e.flatMap(a=>a.result)){if(c.has(a.doc.href))continue;c.set(a.doc.href,a.doc)}if(suggestions.innerHTML="",suggestions.classList.remove('d-none'),c.size===0&&b){const a=document.createElement('div');a.innerHTML=`No results for "<strong>${b}</strong>"`,a.classList.add("suggestion__no-results"),suggestions.appendChild(a);return}for(const[h,g]of c){const b=document.createElement('div');suggestions.appendChild(b);const a=document.createElement('a');a.href=h,b.appendChild(a);const e=document.createElement('span');e.textContent=g.title,e.classList.add("suggestion__title"),a.appendChild(e);const f=document.createElement('span');if(f.textContent=g.description,f.classList.add("suggestion__description"),a.appendChild(f),suggestions.appendChild(b),suggestions.childElementCount==d)break}}})()